import React from "react";
import UserPic from "../assets/userinfo.png";
function Userinfo()
{
    return <div>
    <div className="user-icon">
         <img src={UserPic} alt="user" width={"10px"} height={"20px"} />
        </div>   
    </div>;
}
export default Userinfo;
